import ma2 from '../assets/img/ma2.png';
import '../styles/first.css'; // Import your CSS file where you'll define styles

const First = () => {
    return (
       <div className="container">
         <div className="image-container">
           <img src={ma2} alt="ma2" />
         </div>
       </div>
    );
}

export default First;
